import React, {Component} from 'react'
import Header from "../_layouts/_includes/header/Header";
import {withTheme} from '@material-ui/core/styles';
import ToolbarSpacer from "../common/ToolbarSpacer";
import SteamBackground from "./SteamBackground";
import ProfileHeader from "./ProfileHeader/ProfileHeader";
import ProfileContent from "./ProfileContent/ProfileContent";
import RLongPrimaryImage from "../../assets/img/showcase/long_primary.gif";
import RLongSecondary from "../../assets/img/showcase/long_secondary.jpg";
import RShortPrimary from "../../assets/img/showcase/short_primary.jpg";
import RShortSecondaryOne from "../../assets/img/showcase/short_secondary1.jpg";
import RShortSecondaryTwo from "../../assets/img/showcase/short_secondary2.jpg";
import RShortSecondaryTree from "../../assets/img/showcase/short_secondary3.jpg";

class ShowcaseContainer extends Component {

    constructor(props) {
        super(props)
        this.state = {}

    }

    render() {
        const long = {
            primary: RLongPrimaryImage,
            secondaries: [RLongSecondary],
        }
        const short = {
            primary: RShortPrimary,
            secondaries: [RShortSecondaryOne, RShortSecondaryTwo, RShortSecondaryTree,],
        }
        return (
            <>
                <Header/>
                <ToolbarSpacer theme={this.props.theme}/>

                <SteamBackground>
                    <ProfileHeader />
                    <ProfileContent images={short} />
                </SteamBackground>

            </>
        )
    }
}

export default withTheme(ShowcaseContainer)
